import React from 'react'
import {Link, Switch} from 'react-router-dom'
import Login from './auth/Login'
function Body(){
    return (
        <div>
            <Switch>
                <Route path="Login" component={Login} exact/>
            </Switch>
        </div>
    )
}


export default Body
